import React,{Component} from 'react';
import './Project.css'
import ProjectBox from '../ProjectBox/ProjectBox';
class Projects extends Component{
    render(){

        return(
            <div id="projects-container" className="projects-container">
                <a>This is a Project page!</a>
                <ProjectBox projectName={"Pipe Game"} gif={"https://user-images.githubusercontent.com/38752364/51108566-4a29e300-17fb-11e9-85d2-bd577dea0076.gif"} programLang={"Java | Fxml"}/>
                <div>Oto game</div>
                <div>Pipe game</div>
                <div>Snow over flow</div>
                <div>working on Share it up Web application in react</div>
                <div>server in node</div>
                <a href="https://github.com/NataliAviv">git</a>
            </div>
        );
    }
}

export default Projects;
